function session() {
    var hours = getTime('hours');
    return hours < 5 ? global.Language.get('session', 'night') : hours < 10 ? global.Language.get('session', 'morning') : hours < 17 ? global.Language.get('session', 'noon') : global.Language.get('session', 'night');
}

function getTime(option) {
    switch (option) {
        case "seconds":
        case "s":
            return `${moment.tz("Asia/Ho_Chi_minh").format("ss")}`;
        case "minutes":
        case "m":
            return `${moment.tz("Asia/Ho_Chi_minh").format("mm")}`;
        case "hours":
        case "h":
            return `${moment.tz("Asia/Ho_Chi_minh").format("HH")}`;
        case "date":
        case "d":
            return `${moment.tz("Asia/Ho_Chi_minh").format("DD")}`;
        case "month":
        case "M":
            return `${moment.tz("Asia/Ho_Chi_minh").format("MM")}`;
        case "year":
        case "Y":
            return `${moment.tz("Asia/Ho_Chi_minh").format("YYYY")}`;
        case "fullHour":
        case "FH":
            return `${moment.tz("Asia/Ho_Chi_minh").format("HH:mm:ss")}`;
        case "fullYear":
        case "FY":
            return `${moment.tz("Asia/Ho_Chi_minh").format("DD/MM/YYYY")}`;
        case "fullTime":
        case "FT":
            return `${moment.tz("Asia/Ho_Chi_minh").format("HH:mm:ss DD/MM/YYYY")}`;
        default:
            return `${moment.tz("Asia/Ho_Chi_minh").format(option)}`;
    }
}

