function getRandomNumber(min, max) {
    return Math.floor(Math.random() * (max - min) + min);
}

class Language {
    constructor(locale) {
        if (!language_files.includes(locale + '.json')) return { error: `Not found selected language: ${locale}` };
        this.locale = locale;
        var language = JSON.parse(readFileSync(main + '/systems/language/' + locale + '.json'));
        for (const [key, value] of Object.entries(language)) this[key] = value;
        global.Language = this;
        this.language_error = {
            not_found_region: locale == 'vi' ? "'Region' không được để trống." : "'Region' can't be left clear",
            region_error: locale == 'vi' ? "Không tìm thấy '%1' trong ngôn ngữ này" : "'%1' not found in this language",
            duplicate_region: locale == 'vi' ? 'Đã xảy ra lỗi trùng tên region (%1). Vui lòng kiểm tra và thử lại, điều này xảy ra khi đã có 1 region trùng tên (%1) nhưng là một function.' : 'An error has occurred with the same region name (%1). Please check and try again, this happens when there is already a region with the same name (%0) but as a function.',
            not_found_key: locale == 'vi' ? 'Không tìm thấy key %1 trong region %2 của ngôn ngữ %3, vui lòng kiểm tra và thử lại' : 'Key %1 not found in region %2 of language %3, please check and try again'
        }
    }
    get(...item) {
        try {
            const region = item.shift(), name = item.shift();
            if (!this[region]) throw new Error(this.get('language_error', 'region_error', region));
            if (!this[region][name]) throw new Error(this.get('language_error', 'not_found_key', name, region, this.locale))
            let text = this[region][name], length = item.length;
            for (const key of item.reverse()) text = text.replace(new RegExp('%' + length--, 'g'), key);
            return text;
        } catch (error) {
            return error;
        }
    }
    set(region, name, prop) {
        try {
            if (!region) throw new Error(this.get('language_error', 'not_found_region'));
            if (this[region] && typeof this[region] == 'function') throw new Error(this.get('language_error', 'duplicate_region', region));
            if (!this[region]) this[region] = {};
            this[region][name] = prop;
            return { error: null };
        } catch (error) {
            return { error: error };
        }
    }
    view_informations() {
        return this.informations.replace(/%locale/g, this.locale).replace(/%available/g, language_files.length);
    }
    all_language() {
        for (var item of language_files) if (require.cache[require.resolve(`${main}/systems/language/${item}`)]) delete require.cache[require.resolve(`${main}/systems/language/${item}`)];
        language_files = readdirSync(main + '/systems/language/').filter(name => /.json$/g.test(name));
        return language_files;
    }
    change(locale, Cherry, Cli) {
        try {
            for (let item of language_files) if (require.cache[require.resolve(`${main}/systems/language/${item}`)]) delete require.cache[require.resolve(`${main}/systems/language/${item}`)];
            language_files = readdirSync(main + '/systems/language/').filter(name => /.json$/g.test(name));
            if (!language_files.includes(locale + '.json')) return { error: `Not found selected language: ${locale}` };
            var language = JSON.parse(readFileSync(main + '/systems/language/' + locale + '.json'));
            for (var [key, value] of Object.entries(language)) this[key] = value;
            this.locale = locale;
            global.Language = this;
            var commands_file = readdirSync(main + '/scripts/commands').filter(file => /.js$/.test(file) && !/example/.test(file) && !Cherry.configs.disabled.includes(file));
            var events_file = readdirSync(main + '/scripts/events').filter(file => /.js$/.test(file) && !/example/.test(file) && !Cherry.configs.disabled.includes(file));
            var data = { commands: commands_file, events: events_file };
            load({ Cherry, Cli, data, Language: this });
            return { error: null }
        } catch (error) {
            return { error: error }
        }
    }
}

module.exports = {
    load,
    session,
    getTime,
    auto_ban,
    download,
    calcTime,
    Language,
    createData,
    check_update,
    load_configs,
    calc_timestamp,
    check_database,
    getRandomNumber,
    save_attachments,
    timestamp_to_date,
    date_to_timestamp,
}